import React, { Component } from 'react';
import {connect} from 'react-redux';
import Moment from 'react-moment';
import {Navlink} from 'react-router-dom';
import BillingPlansCards from '../../components/BillingPlan/BillingPlanCards'
import BillingPlansSuscription from '../../components/BillingPlan/BillingPlanSuscription'
import ExpertProfile from '../../components/Expert/ExpertProfile'
import GoogleApiWrapper from '../../components/Expert/LocationGoogleMaps'
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';

class ProfileMain extends Component{
  constructor(props){
    super(props);
    this.state = {}
  }

  componentDidMount(){
    this.props.changeHeaderTitle("Perfil")
  }


  render(){
    return(
      <div>


    <Grid container >
      <Grid item sm={6} >
        <ExpertProfile/>    
      </Grid>  
      <Grid item sm={6} >
        <Button variant="contained" size="large" color="primary">Ver mi página personal</Button>
        <Button variant="contained" size="large" color="primary">Cambiar contraseña</Button>
        <Button variant="contained" size="large" color="primary">Detalles de mi suscripción</Button>
        <Button variant="contained" size="large" color="primary">Recomendar a un amigo</Button>
      </Grid>  
      <Grid container sm={12} >  
        <Grid item sm={6} xs={12}>
          <BillingPlansCards/>
        </Grid>
        <Grid item sm={6} xs={12}>
         <GoogleApiWrapper/>
        </Grid>
      </Grid>
    </Grid>

      </div>
    )
  }
};




function mapStateToProps(state){
  return{

    currentUserId: state.currentUser.user.id
  };
};

export default connect(mapStateToProps, )(ProfileMain);
